SET
@ENTRY          := 500005,
@NAME           := "Soundsinger",
@SUBNAME        := "Jukebox",
@MODEL          := 21661,

@TEXT_ID        := 601500,
@GOSSIP_MENU    := 605000;

/*Data for the table `creature_template` */
DELETE FROM creature_template WHERE entry = @ENTRY AND name = @NAME;

/*Data for the table `creature_template_model` */
DELETE FROM creature_template_model WHERE CreatureID = @ENTRY AND CreatureDisplayID = @MODEL;

/*Data for the table `creature_template_gossip` */
DELETE FROM creature_template_gossip WHERE CreatureID = @ENTRY AND MenuID = @GOSSIP_MENU;

/*Data for the table `gossip_menu` */
DELETE FROM gossip_menu WHERE menuid BETWEEN @GOSSIP_MENU AND @GOSSIP_MENU+45;

/*Data for the table `npc_text` */
DELETE FROM npc_text WHERE ID BETWEEN @TEXT_ID AND @TEXT_ID+6;

/*Data for the table `gossip_menu_option` */
DELETE FROM gossip_menu_option WHERE menuid BETWEEN @GOSSIP_MENU AND @GOSSIP_MENU+45;

/*Data for the table `smart_scripts` */
DELETE FROM smart_scripts WHERE entryorguid = @ENTRY AND source_type = 0;
